import axios from "axios";
import { AllMOVIES, MOVIESAPI } from "../types/moviesTypes";

export const getAllMoviesAction = async () => {
  const res = await axios.get(MOVIESAPI);
  return { type: AllMOVIES, data: res.data.results, pages: 0 };
};
